import { createSlice } from "@reduxjs/toolkit";


const infoShopSlice = createSlice({
  name: "infoShop",
  initialState: { name: "" },
  reducers: {}
});

const { } = infoShopSlice.actions;

export default infoShopSlice.reducer;
